import SignUp from './components/SignUp'
import {
    BrowserRouter as Router,
    Routes,
    Route,
    Link
  } from "react-router-dom";
export default function App() {
  return (
   <Routes>
    <Route path='/user-signup'>{<SignUp/>}</Route>
   </Routes>
  )}
